<template>
    <div class='error-404 loading-group' v-show="delayTemp">
        <img src='data:image/png;base64,' alt='404'>
        <h2>
            页面消失了 </h2>
        <div>
            <el-button @click='back'>返回上一页</el-button>
        </div>
    </div>
</template>
<script>
  const { watch, onMounted, computed, ref } = vue;
  const { useStore, useRouter, useTip, useCache } = hook;
  export default {
    name: 'errorView',
    setup (prop, ctx) {
      const { replace, route, go, children, router } = useRouter(ctx);
      const routerOk = computed(() => useStore(ctx).state.router.length > 0 && ctx.root.initSate);

      let logoutState = false;
      watch(
          () => [ctx.root.initSate, useStore(ctx).getters.isLogin],
          ([init, isLogin]) => {
            if (init) {
              if (!isLogin) {
                ctx.root.loading = true;
                logoutState || useTip().notify('warning', '请先登录账号', '温馨提示');
                const router = useRouter(ctx);
                // 记录下当前页面 url
                useCache({},window['sessionStorage']).setCache('last_url', router.route.fullPath, 100);
                router.replace('/login');
              }
            }
          },
          {immediate: true}
      );

      let delayTemp = ref(false);

      watch(() => routerOk.value, (init) => {
        if (init) {
          replace(route.fullPath).catch(() => {
            delayTemp.value = true;
          })
          document.title = "页面不存在";
          setTimeout(() => ctx.root.loading = false, 60);
        }
      }, { immediate: true });
      onMounted(() => {
        if (routerOk.value) {
          ctx.root.loading = false;
        }
      });

      function back () {
        go(-1);
      }

      return {
        back,
        delayTemp
      };
    }
  };
</script>

<style scoped>
    .error-404 {
        z-index: 998 !important;
    }

    .error-404 img {
        width: 300px;
        margin-top: -30%;
    }

    h2 {
        margin: -35px auto 40px;
    }
</style>
